func TestStoreProfilePic(t *testing.T) {
	mockStub := createChainCode(t)

	idForPicture := "asdfs654321sdf56"

	response1 := mockStub.MockInvoke("j32njkkjn", [][]byte{[]byte("storeProfilePic"),
		[]byte(idForPicture),
		[]byte(""),
	})

	if response1.Status != shim.OK {
		t.Error("Puting data on ledger didn't succeed")
		t.FailNow()
	}
	if !strings.Contains(string(response1.Payload), idForPicture) {
		t.Error("Puting data on ledger didn't return a valid id")
		t.FailNow()
	}

}

func createChainCode(t *testing.T) *shim.MockStub {
	sm := new(DigitalIdentity)
	mockStub := shim.NewMockStub("mockStub", sm)
	if mockStub == nil {
		t.Error("Cannot create MockStub")
		t.FailNow()
	}
	return mockStub
}

type DigitalIdentity struct {
}

// Initialisation of the chain
func (s *DigitalIdentity) Init(APIstub shim.ChaincodeStubInterface) sc.Response {
	return shim.Success(nil)
}

func (s *DigitalIdentity) Invoke(APIstub shim.ChaincodeStubInterface) sc.Response {
	function, args := APIstub.GetFunctionAndParameters()

	switch function {
	case "storeProfilePic":
		return StoreProfilePic(APIstub, args)

	case "retrieveProfilePic":
		return RetrieveProfilePic(APIstub, args)

	default:
		return shim.Error("Error:teststup does not recognise " + function)
	}
}
